import "bootstrap/dist/css/bootstrap.min.css"
import './App.css'
import { Route, Routes } from 'react-router-dom';
import Home from './Pages/Home'
import About from './Pages/About'


function App() {
  return (
    <div >
      <Routes>
        <Route path='/' element={<Home />} exact />
        <Route path='/home' element={<Home />} />
      </Routes>
    </div>
  );
}

export default App;
